@keyframes swipe-out-left { 
  0% { transform: var(--y) translate(var(--swipe-amount-x)); opacity: 1; }
  100% { transform: var(--y) translate(calc(var(--swipe-amount-x) - 100%)); opacity: 0; }
}

@keyframes swipe-out-right { 
  0% { transform: var(--y) translate(var(--swipe-amount-x)); opacity: 1; }
  100% { transform: var(--y) translate(calc(var(--swipe-amount-x) + 100%)); opacity: 0; }
}

@keyframes swipe-out-up { 
  0% { transform: var(--y) translateY(var(--swipe-amount-y)); opacity: 1; }
  100% { transform: var(--y) translateY(calc(var(--swipe-amount-y) - 100%)); opacity: 0; }
}

@keyframes swipe-out-down { 
  0% { transform: var(--y) translateY(var(--swipe-amount-y)); opacity: 1; }
  100% { transform: var(--y) translateY(calc(var(--swipe-amount-y) + 100%)); opacity: 0; }
}

@media (max-width: 600px) {
  [data-sonner-toaster] { position: fixed; right: var(--mobile-offset-right); left: var(--mobile-offset-left); width: 100%; }
  [data-sonner-toaster][dir="rtl"] { left: calc(var(--mobile-offset-left) * -1); }
  [data-sonner-toaster] [data-sonner-toast] { left: 0px; right: 0px; width: calc(100% - var(--mobile-offset-left) * 2); }
  [data-sonner-toaster][data-x-position="left"] { left: var(--mobile-offset-left); }
  [data-sonner-toaster][data-y-position="bottom"] { bottom: var(--mobile-offset-bottom); }
  [data-sonner-toaster][data-y-position="top"] { top: var(--mobile-offset-top); }
  [data-sonner-toaster][data-x-position="center"] { left: var(--mobile-offset-left); right: var(--mobile-offset-right); transform: none; }
}

@keyframes sonner-fade-in { 
  0% { opacity: 0; transform: scale(0.8); }
  100% { opacity: 1; transform: scale(1); }
}

@keyframes sonner-fade-out { 
  0% { opacity: 1; transform: scale(1); }
  100% { opacity: 0; transform: scale(0.8); }
}

@media (prefers-reduced-motion) {
  [data-sonner-toast], [data-sonner-toast] > *, .sonner-loading-bar { transition: none !important; animation: auto ease 0s 1 normal none running none !important; }
}

@media (min-width: 768px) and (max-width: 1200px) {
  .tiktok-cookie-banner .special-button-wrapper button { height: auto; min-height: 44px; white-space: pre-wrap; }
}

@media (max-width: 991px) {
  .tiktok-cookie-banner { flex-direction: column; height: auto; padding: 16px 16px 20px; box-shadow: none; }
  .tiktok-cookie-banner .cookie-content .cookie-title { font-family: tiktok-text-bold, PingFangSC, sans-serif; font-weight: 700; font-size: 16px; line-height: 130%; text-align: center; color: var(--banner-title-color--, #fff); }
  .tiktok-cookie-banner .cookie-content .cookie-desc { font-family: tiktok-text-regular, PingFangSC, sans-serif; font-weight: 400; font-size: 12px; line-height: 130%; width: auto; text-align: center; color: var(--banner-desc-color--, #fff); }
  .tiktok-cookie-banner .cookie-content .cookie-desc a { font-family: tiktok-text-medium, PingFangSC, sans-serif; font-weight: 600; font-size: 12px; line-height: 130%; text-decoration: none; color: var(--banner-link-color--, #fff); }
  .tiktok-cookie-banner .cookie-content .cookie-desc a:hover { text-decoration: underline; color: var(--banner-link-hover-color--, #fff); }
  .tiktok-cookie-banner .button-wrapper { align-self: flex-end; margin-top: 16px; margin-left: 0px; margin-right: 0px; width: 100%; }
  .tiktok-cookie-banner .button-wrapper a, .tiktok-cookie-banner .button-wrapper button { font-family: tiktok-text-medium, PingFangSC, sans-serif; font-weight: 600; font-size: 15px; line-height: 130%; min-width: unset; padding: 0px 6px; width: 100%; height: 44px; border-radius: 2px; white-space: pre-wrap; margin: 0px; }
  .tiktok-cookie-banner .button-wrapper button { margin-left: 8px; height: auto; min-height: 44px; }
}

@media (max-width: 468px) {
  .tiktok-cookie-setting-portal .tiktok-cookie-setting-header-container { border-bottom: none; padding: 32px 24px 24px; font-family: tiktok-display-bold, PingFangSC, sans-serif; font-weight: 700; font-size: 20px; line-height: 125%; justify-content: center; }
